test("nesting", function () {
	assertEqual(render(\'ul\\n  li a\\n  li b\\n  li c\'), \'<ul><li>a</li><li>b</li><li>c</li></ul>\');
	assertEqual(render(\'ul\\n  li\\n    a\\n  li b\'), \'<ul><li><a></a></li><li>b</li></ul>\');
